import React, { useEffect, useState } from 'react';

const Analytics = () => {
  const [analytics, setAnalytics] = useState<any>(null);

  useEffect(() => {
    fetch('http://192.168.1.107:8000/api/analytics')
      .then(res => res.json())
      .then(setAnalytics);
  }, []);

  return (
    <section>
      <h2>Analytics</h2>
      <pre>{JSON.stringify(analytics, null, 2)}</pre>
    </section>
  );
};

export default Analytics;
